#include<stdio.h>
#include<stdlib.h>

int main(){
    int n , m , i , j , k ;
    float sum , sumall;
    scanf("%d %d" ,&n ,&m);
    float rate[n] , score[m][n] , onesum[m];
    for( i=0 ; i<n ; i++){
        scanf("%f",&rate[i]);
        getchar();
    }
    for( j=0 ; j<m ; j++){
        sum =0;
        for( k=0 ; k<n ; k++){
            scanf("%f",&score[j][k]);
            getchar();
            sum = sum +score[j][k]*rate[k];
        }
        onesum[j]=sum;
        sumall = sumall+sum;
    }
    for(int z =0 ;z<m ; z++){
        printf("%.2f",onesum[z]);
        if(z!=m-1)printf(" ");
        else printf("\n");
    }
    printf("%.2f\n",sumall/m);
    return 0 ;
}

// Add to your theme's functions.php or a custom plugin

/**
 * Capture the referring URL before user navigates to the login page.
 */
function wbcom_capture_referring_url() {
    // Check if the current page is the WordPress login page and the user is not logged in
    if ( strpos($_SERVER['REQUEST_URI'], 'wp-login.php') !== false && !is_user_logged_in() ) {
        // Get the referrer URL
        $referrer = wp_get_referer();
        // If there's a referrer, store it in a session variable
        if ( !empty($referrer) ) {
            $_SESSION['wbcom_login_referrer'] = $referrer;
        }
    }
}
add_action('wp', 'wbcom_capture_referring_url');

/**
 * Redirect user to the previously captured URL after successful login.
 */
function wbcom_redirect_after_login( $redirect_to, $requested_redirect_to, $user ) {
    // Check if our session variable with the referrer URL is set
    if ( isset($_SESSION['wbcom_login_referrer']) ) {
        // Store the URL
        $redirect_url = $_SESSION['wbcom_login_referrer'];
        // Unset the session variable for future logins
        unset($_SESSION['wbcom_login_referrer']);
        // Redirect to the stored URL
        return $redirect_url;
    }
    // If no referrer URL was captured, proceed with the default redirect
    return $redirect_to;
}
add_filter('login_redirect', 'wbcom_redirect_after_login', 10, 3);

#include<bits/stdc++.h>
int count_n[15], count_c[4];

int main(){
    char num, c,record_c;
    bool cont=0, same=1;
    for(int i=0;i<5;++i){
        scanf("%c%c", &num, &c);
        getchar();
        c = (char)toupper(c);
        if(i!=0&&c!=record_c)same=0;
        if(isdigit(num)){
            count_n[num-'0']=1;
        }else{
            num = (char)toupper(num);
            if(num=='A')count_n[14]=1;
            else if(num=='T')count_n[10]=1;
            else if(num=='J')count_n[11]=1;
            else if(num=='Q')count_n[12]=1;
            else if(num=='K')count_n[13]=1;
        }
        record_c=c;
    }
    for(int i=2;i<=10;++i){
        if(count_n[i]>0&&count_n[i+1]>0&&count_n[i+2]>0&&count_n[i+3]>0&&count_n[i+4]>0){
            cont=1;
        }
    }
    if(cont)printf("y");
    if(same)printf("s");
    if(!cont&&!same)printf("n");
    return 0;
}

using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace Tablice2d
{
    internal class Program
    {
        static void Main(string[] args)
        {
            int[,] a = new int[2, 3];
            int[,] b = new int[2, 3];
            int[,] c = new int[2, 3];
            Console.WriteLine("Macierz a:");
            for (int i = 0; i < 2; i++)
            {
                for (int j = 0; j < 3; j++)
                {
                    Console.Write($"a[{i},{j}]:  ");
                    a[i, j] = int.Parse(Console.ReadLine());
                }
            }
            Console.Clear();
            Console.WriteLine("Macierz b:");
            for (int i = 0; i < 2; i++)
            {
                for (int j = 0; j < 3; j++)
                {
                    Console.Write($"b[{i},{j}]:  ");
                    b[i, j] = int.Parse(Console.ReadLine());
                }
            }
            Console.Clear();
            Console.WriteLine("Macierz c = a + b:");
            for (int i = 0; i < 2; i++)
            {
                for (int j = 0; j < 3; j++)
                {
                    c[i,j] = a[i,j] + b[i,j];
                    Console.Write($"{c[i,j]} ");
                }
                Console.WriteLine();
            }
            Console.ReadKey();


        }
    }
}

