void findDecreasingSequences(int array[], int n) {
    int count = 0;
    int maxLength = 0;
    int currentLength = 1;

    for (int i = 1; i < n; i++) {
        if (array[i] < array[i - 1]) {
            currentLength++;
            if (currentLength > maxLength) {
                maxLength = currentLength;
            }
        } else {
            if (currentLength > 1) {
                count++;
            }
            currentLength = 1;
        }
    }

    if (currentLength > 1) {
        count++;
    }

    printf("–ë—Ä–æ–π –Ω–∞–º–∞–ª—è–≤–∞—â–∏ —Ä–µ–¥–∏—Ü–∏: %d\n", count);
    printf("–ù–∞–π-–¥—ä–ª–≥–∞—Ç–∞ –Ω–∞–º–∞–ª—è–≤–∞—â–∞ —Ä–µ–¥–∏—Ü–∞: %d\n", maxLength);
}

int main() {
    int n;
    printf("–í—ä–≤–µ–¥–µ—Ç–µ –±—Ä–æ–π –Ω–∞ –µ–ª–µ–º–µ–Ω—Ç–∏—Ç–µ –≤ –º–∞—Å–∏–≤–∞: ");
    scanf("%d", &n);

    int array[n];

    printf("–í—ä–≤–µ–¥–µ—Ç–µ –µ–ª–µ–º–µ–Ω—Ç–∏—Ç–µ –Ω–∞ –º–∞—Å–∏–≤–∞:\n");
    for (int i = 0; i < n; i++) {
        scanf("%d", &array[i]);
    }

    findDecreasingSequences(array, n);

    return 0;
}

