use dashmap::DashMap;
use std::{
    collections::BTreeSet,
    hash::Hash,
    mem::ManuallyDrop,
    ops::{Deref, DerefMut},
    sync::Arc,
};
use tokio::sync::{OwnedRwLockReadGuard, OwnedRwLockWriteGuard, RwLock};

pub trait Empty {
    fn is_empty(&self) -> bool;
}

impl Empty for () {
    fn is_empty(&self) -> bool {
        true
    }
}

impl<V> Empty for BTreeSet<V> {
    fn is_empty(&self) -> bool {
        BTreeSet::is_empty(self)
    }
}

type KeyLockInner<K, V> = Arc<DashMap<K, Arc<RwLock<V>>>>;

#[derive(Clone)]
pub struct KeyLocks<K, V>(KeyLockInner<K, V>);

struct KeyRef<K, V> {
    map: KeyLockInner<K, V>,
    key: K,
}
impl<K: Eq + Hash, V: Empty> KeyRef<K, V> {
    fn remove_if_needed<G: Deref<Target = V>>(&self, guard: &mut ManuallyDrop<G>) {
        if guard.is_empty() {
            self.map.remove_if(&self.key, |_, v| {
                unsafe { ManuallyDrop::drop(guard) };
                Arc::strong_count(v) == 1
            });
        } else {
            unsafe { ManuallyDrop::drop(guard) };
        }
    }
}

pub struct OwnedReadGuard<K: Eq + Hash, V: Empty> {
    key: KeyRef<K, V>,
    guard: ManuallyDrop<OwnedRwLockReadGuard<V>>,
}
impl<K: Eq + Hash, V: Empty> Deref for OwnedReadGuard<K, V> {
    type Target = V;
    fn deref(&self) -> &Self::Target {
        self.guard.deref()
    }
}
impl<K: Eq + Hash, V: Empty> Drop for OwnedReadGuard<K, V> {
    fn drop(&mut self) {
        self.key.remove_if_needed(&mut self.guard);
    }
}

pub struct OwnedWriteGuard<K: Eq + Hash, V: Empty> {
    key: KeyRef<K, V>,
    guard: ManuallyDrop<OwnedRwLockWriteGuard<V>>,
}
impl<K: Eq + Hash, V: Empty> Deref for OwnedWriteGuard<K, V> {
    type Target = V;
    fn deref(&self) -> &Self::Target {
        self.guard.deref()
    }
}

impl<K: Eq + Hash, V: Empty> DerefMut for OwnedWriteGuard<K, V> {
    fn deref_mut(&mut self) -> &mut Self::Target {
        self.guard.deref_mut()
    }
}

impl<K: Eq + Hash, V: Empty> Drop for OwnedWriteGuard<K, V> {
    fn drop(&mut self) {
        self.key.remove_if_needed(&mut self.guard);
    }
}

impl<K: Eq + Hash + Clone, V: Empty + Default> KeyLocks<K, V> {
    pub fn new() -> Self {
        KeyLocks(Arc::default())
    }

    fn key_ref(&self, key: K) -> KeyRef<K, V> {
        KeyRef {
            map: self.0.clone(),
            key,
        }
    }

    pub async fn read(&self, key: K) -> OwnedReadGuard<K, V> {
        OwnedReadGuard {
            key: self.key_ref(key.clone()),
            guard: ManuallyDrop::new(
                self.0
                    .entry(key)
                    .or_insert_with(Arc::default)
                    .clone()
                    .read_owned()
                    .await,
            ),
        }
    }

    pub async fn write(&self, key: K) -> OwnedWriteGuard<K, V> {
        OwnedWriteGuard {
            key: self.key_ref(key.clone()),
            guard: ManuallyDrop::new(
                self.0
                    .entry(key)
                    .or_insert_with(Arc::default)
                    .clone()
                    .write_owned()
                    .await,
            ),
        }
    }

    pub fn len(&self) -> usize {
        self.0.len()
    }
}

#[cfg(test)]
mod test {
    use super::KeyLocks;
    use std::collections::BTreeSet;

    #[tokio::test]
    async fn drop_only_if_empty() {
        let locks = KeyLocks::<u32, BTreeSet<String>>::new();

        let mut lock = locks.write(1).await;
        lock.insert("Hello".to_owned());
        lock.insert("World".to_owned());
        drop(lock);

        // Value is not empty and thus is not dropped
        assert_eq!(locks.len(), 1);

        let mut lock = locks.write(1).await;
        assert_eq!(lock.len(), 2);
        lock.clear();
        drop(lock);

        // Should be dropped now
        assert_eq!(locks.len(), 0);
    }
}

package lab3.Queue.Array;

public class Queue {
    public static final int CAPACITY = 10;
    private char[] array; // –ú–∞—Å—Å–∏–≤ —Ö—Ä–∞–Ω—â–∏—Ö—Å—è –æ—Ç–ø—Ä–∞–≤–ª–µ–Ω–∏–π
    private int start, end; // –£–∫–∞–∑–∞—Ç–µ–ª–∏ –Ω–∞ –Ω–∞—á–∞–ª–æ –∏ –∫–æ–Ω–µ—Ü –æ—á–µ—Ä–µ–¥–∏ (–≤–∫–ª—é—á–∏—Ç–µ–ª—å–Ω–æ)

    public Queue(){
        array = new char[CAPACITY+1]; // –í—ã–¥–µ–ª—è–µ–º –ø–∞–º—è—Ç—å –ø–æ–¥ –º–∞—Å—Å–∏–≤ (1 –¥–æ–ø —è—á–µ–π–∫–∞ –¥–ª—è –æ–ø—Ä–µ–¥–µ–ª–µ–Ω–∏—è –∑–∞–ø–æ–ª–Ω–µ–Ω–Ω–æ—Å—Ç–∏ –∏ –ø—É—Å—Ç–æ—Ç—ã)
        start = 0;
        end = CAPACITY;
        // –û—á–µ—Ä–µ–¥—å –ø—É—Å—Ç–∞
    }

    public void MakeNull(){ // –ú–µ—Ç–æ–¥ –¥–µ–ª–∞–µ—Ç –æ—á–µ—Ä–µ–¥—å –ø—É—Å—Ç–æ–π
        start = NextIndex(NextIndex(end)); // –î–µ–ª–∞–µ–º start –∏–¥—É—â–∏–º –Ω–∞ 2 –∏–Ω–¥–µ–∫—Å–∞ –ø–µ—Ä–µ–¥
    }

    public char Front(){ // –º–µ—Ç–æ–¥ –≤–æ–∑–≤—Ä–∞—â–∞–µ—Ç –∫–æ–ø–∏—é –ø–µ—Ä–≤–æ–≥–æ —ç–ª–µ–º–µ–Ω—Ç–∞
        return array[start];
    }

    public char Dequeue(){ // –ú–µ—Ç–æ–¥ —É–¥–∞–ª—è–µ—Ç –ø–µ—Ä–≤—ã–π —ç–ª–µ–º–µ–Ω—Ç –æ—á–µ—Ä–µ–¥–∏ –∏ –≤–æ–∑–≤—Ä–∞—â–∞–µ—Ç –µ–≥–æ
        char out = array[start]; // –ü–æ–ª—É—á–∞–µ–º –∫–æ–ø–∏—é –ø–µ—Ä–≤–æ–≥–æ —ç–ª–µ–º–µ–Ω—Ç–∞
        start = NextIndex(start); // –î–≤–∏–≥–∞–µ–º —É–∫–∞–∑–∞—Ç–µ–ª—å –Ω–∞—á–∞–ª–∞
        return out;
    }

    public void Enqueue(char x){ // –ú–µ—Ç–æ–¥ –¥–æ–±–∞–≤–ª—è–µ—Ç —ç–ª–µ–º–µ–Ω—Ç –≤ –∫–æ–Ω–µ—Ü –æ—á–µ—Ä–µ–¥–∏
        end = NextIndex(end); // –°–¥–≤–∏–≥–∞–µ–º —É–∫–∞–∑–∞—Ç–µ–ª—å –∫–æ–Ω—Ü–∞ –¥–∞–ª—å—à–µ
        array[end] = x; // –ó–∞–ø–∏—Å—ã–≤–∞–µ–º –≤ –º–∞—Å—Å–∏–≤
    }

    public boolean Empty(){ // true –µ—Å–ª–∏ –æ—á–µ—Ä–µ–¥—å –ø—É—Å—Ç–∞—è
        return NextIndex(end) == start; // –ï—Å–ª–∏ end –Ω–∞—Ö–æ–¥–∏—Ç—Å—è —Å—Ä–∞–∑—É –ø–µ—Ä–µ–¥ start –º–∞—Å—Å–∏–≤ –ø—É—Å—Ç–æ–π
    }

    public boolean Full(){ // true –µ—Å–ª–∏ –æ—á–µ—Ä–µ–¥—å –∑–∞–ø–æ–ª–Ω–µ–Ω–∞
        return NextIndex(NextIndex(end)) == start; // –ï—Å–ª–∏ end –º–µ–Ω—å—à–µ start –Ω–∞ 2 –º–∞—Å—Å–∏–≤ –ø–æ–ª–Ω—ã–π todo –∞—Ä–∏—Ñ–º–µ—Ç–∏—á–µ—Å–∫–∏ –∏–ª–∏ —á–µ—Ä–µ–∑ –º–µ—Ç–æ–¥?
    }

    private int NextIndex(int i){ // –ú–µ—Ç–æ–¥ –≤–æ–∑–≤—Ä–∞—â–∞–µ—Ç —Å–ª–µ–¥—É—é—â–∏–π –∏–Ω–¥–µ–∫—Å –≤ –∫–æ–ª—å—Ü–µ–≤–æ–º —Å–ø–∏—Å–∫–µ
        return (i+1)%(CAPACITY+1); // –û—Å—Ç–∞—Ç–æ–∫ –æ—Ç –¥–µ–ª–µ–Ω–∏—è –Ω–∞ —Ä–∞–∑–º–µ—Ä—ã –º–∞—Å—Å–∏–≤–∞
    }
}

