// –ö–ª–∞—Å—Å –ø–æ—á—Ç–æ–≤–æ–≥–æ –æ—Ç–ø—Ä–∞–≤–ª–µ–Ω–∏—è
public class Sending {
    public static final int NAME_CAPACITY = 30;
    public static final int ADRESS_CAPACITY = 50;
    public char name[] = new char[NAME_CAPACITY]; // –ú–∞—Å—Å–∏–≤ —Å–∏–º–≤–æ–ª–æ–≤ –∏–º–µ–Ω–∏ –ø–æ–ª—É—á–∞—Ç–µ–ª—è
    public char adress[] = new char[ADRESS_CAPACITY]; // –ú–∞—Å—Å–∏–≤ —Å–∏–º–≤–æ–ª–æ–≤ –∞–¥—Ä–µ—Å–∞

    public static void copyArrayToArray(char[] a, char[] out){ // –°—Ç–∞—Ç–∏—á–µ—Å–∫–∏–π –≤—Å–ø–æ–º–æ–≥–∞—Ç–µ–ª—å–Ω—ã–π –º–µ—Ç–æ–¥ –≤–æ–∑–≤—Ä–∞—â–∞–µ—Ç –∫–æ–ø–∏—Ä—É–µ—Ç —Å–∏–º–≤–æ–ª—ã –∏–∑ –ø–µ—Ä–≤–æ–≥–æ –º–∞—Å—Å–∏–≤–∞ –≤–æ –≤—Ç–æ—Ä–æ–π
        for (int i=0; i<a.length; i++)
            out[i] = a[i];
    }

    private static void copyStringToArray(String s, char[] array){ // –°—Ç–∞—Ç–∏—á–µ—Å–∫–∏–π –º–µ—Ç–æ–¥ –∑–∞–ø–æ–ª–Ω—è–µ—Ç –º–∞—Å—Å–∏–≤ —Å–∏–º–≤–æ–ª–æ–≤ —Å–æ–¥–µ—Ä–∂–∏–º—ã–º –ø–µ—Ä–µ–¥–∞–Ω–Ω–æ–π —Å—Ç—Ä–æ–∫–∏
        int len = s.length();
        for (int i=0; i<len; i++)
            array[i] = s.charAt(i);
    }

    public Sending(char[] name, char[] adress){ // –ö–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä, –ø—Ä–∏–Ω–∏–º–∞—é—â–∏–π –º–∞—Å—Å–∏–≤—ã —Å–∏–º–≤–æ–ª–æ–≤ –∏ –∫–æ–ø–∏—Ä—É—é—â–∏–π –∏—Ö –≤ –ø–æ–ª—è –æ–±—ä–µ–∫—Ç–∞
        copyArrayToArray(name, this.name);
        copyArrayToArray(adress, this.adress);
    }

    // –ö–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä
    public Sending(String name, String adress){
        // –ö–æ–ø–∏—Ä–æ–≤–∞–Ω–∏–µ —Å—Ç—Ä–æ–∫–∏ –≤ –º–∞—Å—Å–∏–≤
        copyStringToArray(name, this.name);
        copyStringToArray(adress, this.adress);
    }

    // –ö–æ–ø–∏—Ä—É—é—â–∏–π –∫–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä
    public Sending(Sending s){
        // –ö–æ–ø–∏—Ä–æ–≤–∞–Ω–∏–µ –º–∞—Å—Å–∏–≤–æ–≤
        copyArrayToArray(s.name, name);
        copyArrayToArray(s.adress, adress);
    }

    // –ü–µ—Ä–µ–≥—Ä—É–∑–∫–∞ –º–µ—Ç–æ–¥–∞ —Ä–∞–≤–µ–Ω—Å—Ç–≤–∞ —ç–∫–∑–µ–º–ø–ª—è—Ä–æ–≤ –ø–æ —Å–æ–¥–µ—Ä–∂–∏–º–æ–º—É
    public boolean equals(Sending obj) {
        if (this == obj) // –µ—Å–ª–∏ —ç—Ç–æ –æ–¥–∏–Ω –∏ —Ç–æ—Ç –∂–µ –æ–±—ä–µ–∫—Ç,
            return true;

        for (int i=0; i< NAME_CAPACITY; i++) // –ï—Å–ª–∏ –æ–¥–∏–Ω –∏–∑ —ç–ª–µ–º–µ–Ω—Ç–æ–≤ –Ω–µ —Ä–∞–≤–µ–Ω —Å–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤—É—é—â–µ–º—É –≤ –¥—Ä—É–≥–æ–º –º–∞—Å—Å–∏–≤–µ -- false
            if (obj.name[i] != name[i])
                return false;

        for (int i=0; i< ADRESS_CAPACITY; i++) // –ï—Å–ª–∏ –æ–¥–∏–Ω –∏–∑ —ç–ª–µ–º–µ–Ω—Ç–æ–≤ –Ω–µ —Ä–∞–≤–µ–Ω —Å–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤—É—é—â–µ–º—É –≤ –¥—Ä—É–≥–æ–º –º–∞—Å—Å–∏–≤–µ -- false
            if (obj.adress[i] != adress[i])
                return false;

        // –ï—Å–ª–∏ –¥–æ—à–ª–∏ –¥–æ –∫–æ–Ω—Ü–∞, –æ–Ω–∏ —Ä–∞–≤–Ω—ã
        return true;
    }

    // –ü–µ—Ä–µ–≥—Ä—É–∑–∫–∞ –º–µ—Ç–æ–¥–∞ —Å—Ç—Ä–æ–∫–æ–≤–æ–≥–æ –ø—Ä–µ–¥—Å—Ç–∞–≤–ª–µ–Ω–∏—è
    public String toString() {
        // –ò—Å–ø–æ–ª—å–∑—É–µ–º StringBuilder –¥–ª—è –∫–æ–Ω–∫–∞—Ç–µ–Ω–∞—Ü–∏–∏ —Å—Ç—Ä–æ–∫
        StringBuilder build = new StringBuilder(name.length + adress.length + 4);
        build.append("\"");
        for (int i=0; i<NAME_CAPACITY; i++){ // –í —Ü–∏–∫–ª–µ –ø–æ –º–∞—Å—Å–∏–≤—É –∏–º–µ–Ω–∏ –≤—ã–≤–æ–¥–∏–º
            if (name[i] == Character.UNASSIGNED) break; // –ü–æ–∫–∞ –Ω–µ –¥–æ—à–ª–∏ –¥–æ –Ω–µ –æ–ø—Ä–µ–¥–µ–ª—ë–Ω–Ω–æ–≥–æ —Å–∏–º–≤–æ–ª–∞
            build.append(name[i]);
        }
        build.append(": ");
        for (int i=0; i<ADRESS_CAPACITY; i++){ // –í —Ü–∏–∫–ª–µ –ø–æ –º–∞—Å—Å–∏–≤—É –∞–¥—Ä–µ—Å–∞ –≤—ã–≤–æ–¥–∏–º
            if (adress[i] == Character.UNASSIGNED) break; // –ü–æ–∫–∞ –Ω–µ –¥–æ—à–ª–∏ –¥–æ –Ω–µ –æ–ø—Ä–µ–¥–µ–ª—ë–Ω–Ω–æ–≥–æ —Å–∏–º–≤–æ–ª–∞
            build.append(adress[i]);
        }
        build.append("\"");

        return build.toString();
    }
}

package lab12.linkedList;
