// –ö–ª–∞—Å—Å —Å–ø–∏—Å–∫–∞ —Ä–µ–∞–ª–∏–∑–æ–≤–∞–Ω–Ω—ã–π –Ω–∞ –º–∞—Å—Å–∏–≤–µ
public class List{
    private  Item head; // –ù–∞—á–∞–ª–æ —Å–ø–∏—Å–∫–∞

    public class Position { // –ö–ª–∞—Å—Å –ø–æ–∑–∏—Ü–∏–∏ –≤ —Å–ø–∏—Å–∫–µ
        private Item item; // –ê–¥—Ä–µ—Å –Ω–∞ —ç–ª–µ–º–µ–Ω—Ç —Å–ø–∏—Å–∫–∞

        private Position(Item item){
            this.item = item;
        } // –ö–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä

        public boolean equals(Position obj) { // –ø–µ—Ä–µ–≥—Ä—É–∑–∫–∞ –º–µ—Ç–æ–¥–∞ —Ä–∞–≤–µ–Ω—Å—Ç–≤–∞ —ç–∫–∑–µ–º–ø–ª—è—Ä–æ–≤ –ø–æ —Å–æ–¥–µ—Ä–∂–∏–º–æ–º—É
