        }
    }

    // –ö–ª–∞—Å—Å —ç–ª–µ–º–µ–Ω—Ç–∞ —Å–≤—è–∑–Ω–æ–≥–æ —Å–ø–∏—Å–∫–∞
    private class Item{
        Sending content; // –û–±—ä–µ–∫—Ç –ø–æ—á—Ç–æ–≤–æ–≥–æ –æ—Ç–ø—Ä–∞–≤–ª–µ–Ω–∏—è
        Item next; // –°—Å—ã–ª–∫–∞ –Ω–∞ —Å–ª–µ–¥—É—é—â–∏–π —ç–ª–µ–º–µ–Ω—Ç –≤ —Å–ø–∏—Å–∫–µ

        public Item(Sending s){ // –ö–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä, –ø—Ä–∏–Ω–∏–º–∞—é—â–∏–π –æ–±—ä–µ–∫—Ç –æ—Ç–ø—Ä–∞–≤–ª–µ–Ω–∏—è
            content = new Sending(s); // –ö–æ–ø–∏—Ä—É–µ–º –æ–±—ä–µ–∫—Ç –∏ –∑–∞–ø–∏—Å—ã–≤–∞–µ–º –∫–æ–ø–∏—é
            this.next = null;
        }
        public Item(Item item){ // –ö–æ–ø–∏—Ä—É—é—â–∏–π –∫–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä —ç–ª–µ–º–µ–Ω—Ç–∞ —Å–ø–∏—Å–∫–∞
            content = new Sending(item.content); // –í—ã–∑—ã–≤–∞–µ–º –∫–æ–ø–∏—Ä—É—é—â–∏–π –∫–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä –æ–±—ä–µ–∫—Ç–∞ –æ—Ç–ø—Ä–∞–≤–ª–µ–Ω–∏—è
            next = item.next;
        }
    }

    public Position End() { // –í–æ–∑–≤—Ä–∞—â–∞–µ—Ç —Å—Å—ã–ª–∫—É –Ω–∞ –ø–µ—Ä–≤—É—é —Å–≤–æ–±–æ–¥–Ω—É—é –ø–æ–∑–∏—Ü–∏—é
        return new Position(null);
    }

    public void Insert(Sending x, Position position) { // –í—Å—Ç–∞–≤–∫–∞ —ç–ª–µ–º–µ–Ω—Ç–∞ –Ω–∞ –ø–æ–∑–∏—Ü–∏—é
        Item item = position.item; // –ò–∑–≤–ª–µ—á–µ–Ω–∏–µ —ç–ª–µ–º–µ–Ω—Ç–∞ –∏–∑ –∫–ª–∞—Å—Å–∞ –ø–æ–∑–∏—Ü–∏–∏


        if (item == null) { // –ï—Å–ª–∏ –≤—Å—Ç–∞–≤–ª—è–µ–º –ø–æ—Å–ª–µ –ø–æ—Å–ª–µ–¥–Ω–µ–≥–æ
            if (head == null) { // –µ—Å–ª–∏ —Å–ø–∏—Å–æ–∫ –ø—É—Å—Ç–æ–π, –∏–Ω–∏—Ü–∏–∞–ª–∏–∑–∏—Ä—É–µ–º –≥–æ–ª–æ–≤—É
                head = new Item(x);
                return;
            }
            // –ï—Å–ª–∏ –≤—Å—Ç–∞–≤–∫–∞ –≤ –ø–µ—Ä–≤—ã–π —Å–≤–æ–±–æ–¥–Ω—ã–π
            Item tail = getTail(); // –ò—â–µ–º –ø–æ—Å–ª–µ–¥–Ω–∏–π —ç–ª–µ–º–µ–Ω—Ç —Å–ø–∏—Å–∫–∞
            tail.next = new Item(x); // –î–æ–±–∞–≤–ª—è–µ–º –≤ –∫–æ–Ω–µ—Ü –Ω–æ–≤—ã–π —ç–ª–µ–º–µ–Ω—Ç —Å –≤—Ö–æ–¥–Ω—ã–º —Å–æ–¥–µ—Ä–∂–∏–º—ã–º
            position.item = tail.next; // –ù—É–ª–µ–≤–∞—è –ø–æ–∑–∏—Ü–∏—è —Ç–µ–ø–µ—Ä—å —É–∫–∞–∑—ã–≤–∞–µ—Ç –Ω–∞ –≤—Å—Ç–∞–≤–ª–µ–Ω–Ω—ã–π —ç–ª–µ–º–µ–Ω—Ç
            return;
        }

        if (head == null) return; // –ï—Å–ª–∏ —Å–ø–∏—Å–æ–∫ –ø—É—Å—Ç–æ–π –∞ –ø–æ–∑–∏—Ü–∏—è –¥–∞–Ω–∞ –∫–æ–Ω–∫—Ä–µ—Ç–Ω–∞—è, –¥–∞–∂–µ –Ω–µ –ø—ã—Ç–∞–µ–º—Å—è

        if (item != head) // –ï—Å–ª–∏ –ø–æ–∑–∏—Ü–∏—è –Ω–µ —É–∫–∞–∑—ã–≤–∞–µ—Ç –Ω–∞ –≥–æ–ª–æ–≤—É —Ç–æ –µ—ë –º–æ–∂–µ—Ç –Ω–µ –±—ã—Ç—å
            if (findPreviousPos(item) == null) // –µ—Å–ª–∏ –ø—Ä–µ–¥—ã–¥—É—â–∏–π –Ω–∞–π–¥–µ–Ω–Ω—ã–π —ç–ª–µ–º–µ–Ω—Ç null —Ç–æ –ø–æ–∑–∏—Ü–∏–∏ –Ω–µ—Ç –≤ —Å–ø–∏—Å–∫–µ
                return;

        item.next = new Item(item); // —Å–∫–æ–ø–∏—Ä–æ–≤–∞—Ç—å —ç–ª–µ–º–µ–Ω—Ç –∏–∑ –ø–æ–∑–∏—Ü–∏–∏ –≤ –Ω–æ–≤—ã–π new Item(prev) –∏ –≤—Å—Ç–∞–≤–∏—Ç—å –µ–≥–æ –ø–æ—Å–ª–µ –ø–æ–∑–∏—Ü–∏–∏
        item.content = new Sending(x); // –∏–∑–º–µ–Ω–∏—Ç—å —Å–æ–¥–µ—Ä–∂–∏–º–æ–µ –¥–∞–Ω–Ω–æ–π –ø–æ–∑–∏—Ü–∏–∏ –Ω–∞ –Ω–æ–≤–æ–µ –æ—Ç–ø—Ä–∞–≤–ª–µ–Ω–∏–µ(–∫–æ–ø–∏—é)

    }

    public Position Locate(Sending x) { // –ü–æ–∏—Å–∫ –ø–æ–∑–∏—Ü–∏–∏ —ç–ª–µ–º–µ–Ω—Ç–∞ (–ø–µ—Ä–≤—ã–π –ø–æ–ø–∞–≤—à–∏–π—Å—è)
        for (Item p = head; p != null; p = p.next) // –ü—Ä–æ—Ö–æ–¥ –ø–æ —Å–ø–∏—Å–∫—É –ø–æ–∫–∞ –Ω–µ –Ω–∞–π–¥—ë–º —ç–ª–µ–º–µ–Ω—Ç —Å –∏–¥–µ–Ω—Ç–∏—á–Ω—ã–º —Å–æ–¥–µ—Ä–∂–∏–º—ã–º
            if (p.content.equals(x))
                return new Position(p);

        return new Position(null);
    }

    public Sending Retrieve(Position position) { // –í–æ–∑–≤—Ä–∞—â–∞–µ—Ç —ç–ª–µ–º–µ–Ω—Ç –Ω–∞ –ø–æ–∑–∏—Ü–∏–∏
        Item item = position.item; // –ò–∑–≤–ª–µ—á–µ–Ω–∏–µ —ç–ª–µ–º–µ–Ω—Ç–∞ –∏–∑ –∫–ª–∞—Å—Å–∞ –ø–æ–∑–∏—Ü–∏–∏

        if (item == null) // –ï—Å–ª–∏ –ø–æ–∑–∏—Ü–∏—è –ø–æ—Å–ª–µ –ø–æ—Å–ª–µ–¥–Ω–µ–≥–æ –≤—ã–±—Ä–∞—Å—ã–≤–∞–µ–º –∏—Å–∫–ª—é—á–µ–Ω–∏–µ
            throw new MyException();

        if (head == item) // –ï—Å–ª–∏ —ç–ª–µ–º–µ–Ω—Ç —è–≤–ª—è–µ—Ç—Å—è –≥–æ–ª–æ–≤–æ–π, –≤–æ–∑–≤—Ä–∞—â–∞–µ–º –µ–≥–æ —Å–æ–¥–µ—Ä–∂–∏–º–æ–µ
            return new Sending(head.content);

        Item prev = findPreviousPos(item); // –ò—â–µ–º —ç–ª–µ–º–µ–Ω—Ç –ø–µ—Ä–µ–¥ –∑–∞–¥–∞–Ω–Ω—ã–º
        if (prev != null) // –µ—Å–ª–∏ –Ω–µ –±—ã–ª –≤–æ–∑–≤—Ä–∞—â—ë–Ω null —Å–ª–µ–¥—É—é—â–∏–π —ç–ª–µ–º–µ–Ω—Ç –∏–º–µ–µ—Ç –Ω—É–∂–Ω–æ–µ —Å–æ–¥–µ—Ä–∂–∏–º–æ–µ, –≤–æ–∑–≤—Ä–∞—â–∞–µ–º
            return new Sending(item.content);
        else // –ò–Ω–∞—á–µ –ø–æ–∑–∏—Ü–∏–∏ –Ω–µ—Ç –≤ —Å–ø–∏—Å–∫–µ, –≤—ã–±—Ä–∞—Å—ã–≤–∞–µ–º –∏—Å–∫–ª—é—á–µ–Ω–∏–µ
            throw new MyException();
    }

    public void Delete(Position position) { // –£–¥–∞–ª—è–µ—Ç —ç–ª–µ–º–µ–Ω—Ç —Å –ø–æ–∑–∏—Ü–∏–∏
        Item item = position.item; // –ò–∑–≤–ª–µ—á–µ–Ω–∏–µ —ç–ª–µ–º–µ–Ω—Ç–∞ –∏–∑ –∫–ª–∞—Å—Å–∞ –ø–æ–∑–∏—Ü–∏–∏

        if (head == null || item == null) return; // –ï—Å–ª–∏ —Å–ø–∏—Å–æ–∫ –ø—É—Å—Ç–æ–π –∏–ª–∏ –ø—Ä–æ—Å—è—Ç —É–¥–∞–ª–∏—Ç—å —ç–ª–µ–º–µ–Ω—Ç –ø–æ—Å–ª–µ –ø–æ—Å–ª–µ–¥–Ω–µ–≥–æ, –Ω–∏—á–µ–≥–æ –Ω–µ –¥–µ–ª–∞–µ–º


        if (item == head){ // –ï—Å–ª–∏ –Ω–∞–¥–æ —É–¥–∞–ª–∏—Ç—å –≥–æ–ª–æ–≤—É, –¥–≤–∏–≥–∞–µ–º –µ—ë –≤–ø–µ—Ä—ë–¥ –ø–æ —Å–ø–∏—Å–∫—É
            head = head.next;
            position.item = item.next; // –ò–∑–º–µ–Ω—è–µ–º —ç–ª–µ–º–µ–Ω—Ç –ø–æ–∑–∏—Ü–∏–∏ –Ω–∞ —Å–ª–µ–¥—É—é—â–∏–π
            return;
        }

        Item prev = findPreviousPos(item); // –ò—â–µ–º —ç–ª–µ–º–µ–Ω—Ç –ø–µ—Ä–µ–¥ –∑–∞–¥–∞–Ω–Ω—ã–º

        if (prev != null) { // –µ—Å–ª–∏ –Ω–µ –±—ã–ª –≤–æ–∑–≤—Ä–∞—â—ë–Ω null —Å–ª–µ–¥—É—é—â–∏–π —ç–ª–µ–º–µ–Ω—Ç –∏–º–µ–µ—Ç –Ω—É–∂–Ω–æ–µ —Å–æ–¥–µ—Ä–∂–∏–º–æ–µ, –æ—Ç–≤—è–∑—ã–≤–∞–µ–º –∏ –æ–±—Ö–æ–¥–∏–º
            prev.next = item.next; // –í–º–µ—Å—Ç–æ —É–¥–∞–ª—è–µ–º–æ–≥–æ, –∑–∞–ø–∏—Å—ã–≤–∞–µ–º —Å—Å—ã–ª–∫—É –Ω–∞ —ç–ª–µ–º–µ–Ω—Ç –ø–æ—Å–ª–µ –Ω–µ–≥–æ
            position.item = item.next; // –ò–∑–º–µ–Ω—è–µ–º —ç–ª–µ–º–µ–Ω—Ç –ø–æ–∑–∏—Ü–∏–∏ –Ω–∞ —Å–ª–µ–¥—É—é—â–∏–π
        }
        // –ï—Å–ª–∏ –ø–æ–∑–∏—Ü–∏–∏ –Ω–µ—Ç, –Ω–∏—á–µ–≥–æ –Ω–µ –¥–µ–ª–∞–µ–º
    }

    public Position Next(Position position) { // –í–æ–∑–≤—Ä–∞—â–∞–µ—Ç —Å–ª–µ–¥—É—é—â—É—é –ø–æ–∑–∏—Ü–∏—é
        Item item = position.item; // –ò–∑–≤–ª–µ—á–µ–Ω–∏–µ —ç–ª–µ–º–µ–Ω—Ç–∞ –∏–∑ –∫–ª–∞—Å—Å–∞ –ø–æ–∑–∏—Ü–∏–∏

        if (item == null) // –ï—Å–ª–∏ –ø–æ–∑–∏—Ü–∏—è –ø–æ—Å–ª–µ –ø–æ—Å–ª–µ–¥–Ω–µ–≥–æ –∫–∏–¥–∞–µ–º –∏—Å–∫–ª—é—á–µ–Ω–∏–µ
            throw new MyException();

        if (item == head) // –ï—Å–ª–∏ –Ω–∞ –≤—Ö–æ–¥ –¥–∞–ª–∏ –≥–æ–ª–æ–≤—É, –≤–æ–∑–≤—Ä–∞—â–∞–µ–º —Å–ª–µ–¥—É—é—â–∏–π
