        Item prev = findPreviousPos(item); // –ò—â–µ–º —ç–ª–µ–º–µ–Ω—Ç –≤ —Å–ø–∏—Å–∫–µ, –ø–µ—Ä–µ–¥ –∑–∞–¥–∞–Ω–Ω—ã–º

        if (prev != null) // –µ—Å–ª–∏ –Ω–µ –±—ã–ª –≤–æ–∑–≤—Ä–∞—â—ë–Ω null, —Ç–æ —ç–ª–µ–º–µ–Ω—Ç –µ—Å—Ç—å –≤ —Å–ø–∏—Å–∫–µ
            return new Position(item.next);
        else // –ò–Ω–∞—á–µ –ø–æ–∑–∏—Ü–∏–∏ –Ω–µ—Ç –≤ —Å–ø–∏—Å–∫–µ, –≤—ã–±—Ä–∞—Å—ã–≤–∞–µ–º –∏—Å–∫–ª—é—á–µ–Ω–∏–µ
            throw new MyException();
    }

    public Position Previous(Position position) { // –í–æ–∑–≤—Ä–∞—â–∞–µ—Ç –ø—Ä–µ–¥—ã–¥—É—â—É—é –ø–æ–∑–∏—Ü–∏—é
        Item prev = findPreviousPos(position.item); // –ü–æ–∏—Å–∫ —ç–ª–µ–º–µ–Ω—Ç–∞ –ø–µ—Ä–µ–¥ –∑–∞–¥–∞–Ω–Ω—ã–º
        if (prev == null) // –µ—Å–ª–∏ –ø–æ–ª—É—á–∏–ª–∏ null –∑–Ω–∞—á–∏—Ç –ª–∏–±–æ –ø–æ–∑–∏—Ü–∏–∏ –Ω–µ—Ç –≤ —Å–ø–∏—Å–∫–µ, –ª–∏–±–æ —ç—Ç–æ –≥–æ–ª–æ–≤–∞, –≤—ã–±—Ä–∞—Å—ã–≤–∞–µ–º –∏—Å–∫–ª—é—á–µ–Ω–∏–µ
            throw new MyException();

        return new Position(prev); // –í–æ–∑–≤—Ä–∞—â–∞–µ–º –ø–æ–∑–∏—Ü–∏—é —Å –ø—Ä–µ–¥—ã–¥—É—â–∏–º —ç–ª–µ–º–µ–Ω—Ç–æ–º
    }

    public void MakeNull() { // –ú–µ—Ç–æ–¥ –¥–µ–ª–∞–µ—Ç –º–∞—Å—Å–∏–≤ –ø—É—Å—Ç—ã–º
        head = null; // –ó–∞–Ω—É–ª—è–µ–º –≥–æ–ª–æ–≤—É
    }

    // –í—ã–≤–æ–¥ –ø–æ–∑–∏—Ü–∏–∏ –ø–µ—Ä–≤–æ–≥–æ —ç–ª–µ–º–µ–Ω—Ç–∞, –µ—Å–ª–∏ —Ç–∞–∫–æ–≤–æ–≥–æ –Ω–µ—Ç, –≤—ã–≤–æ–¥–∏—Ç –ø–æ–∑–∏—Ü–∏—é –ø–æ—Å–ª–µ –ø–æ—Å–ª–µ–¥–Ω–µ–≥–æ
    public Position First() {
        return new Position(head); // –í—ã–≤–æ–¥–∏–º –∞–¥—Ä–µ—Å —Ö—Ä–∞–Ω—è—â–∏–π—Å—è –≤ head
    }

    public void PrintList() { // –í—ã–≤–æ–¥–∏—Ç –º–∞—Å—Å–∏–≤ –Ω–∞ —ç–∫—Ä–∞–Ω
        for (Item p = head; p != null; p = p.next)
            System.out.print(p.content + " "); // –í—ã–≤–æ–¥–∏–º —á–µ—Ä–µ–∑ –ø—Ä–æ–±–µ–ª —Å—Ç—Ä–æ–∫–æ–≤—ã–µ –ø—Ä–µ–¥—Å—Ç–∞–≤–ª–µ–Ω–∏—è —ç–ª–µ–º–µ–Ω—Ç–æ–≤
        System.out.println();
    }

    // –í—Å–ø–æ–º–æ–≥–∞—Ç–µ–ª—å–Ω—ã–π –º–µ—Ç–æ–¥, –Ω–∞—Ö–æ–¥–∏—Ç —ç–ª–µ–º–µ–Ω—Ç –ü–ï–†–ï–î –≤—Ö–æ–¥–Ω—ã–º, –µ—Å–ª–∏ –ø–æ–∑–∏—Ü–∏–∏ –Ω–µ—Ç –∏–ª–∏ –æ–Ω–∞ –ø–µ—Ä–≤–∞—è, –≤–æ–∑–≤—Ä–∞—â–∞–µ—Ç null
    private Item findPreviousPos(Item item){
        for (Item p = head; p != null; p = p.next){  // –ü—Ä–æ—Ö–æ–¥ —É–∫–∞–∑–∞—Ç–µ–ª–µ–º P –ø–æ —Å–≤—è–∑–Ω–æ–º—É —Å–ø–∏—Å–∫—É
            Item n = p.next; // –≠–ª–µ–º–µ–Ω—Ç –ø–æ—Å–ª–µ p
            if (n == item) // –µ—Å–ª–∏ n —ç—Ç–æ –∏ –µ—Å—Ç—å –≤—Ö–æ–¥–Ω–∞—è –ø–æ–∑–∏—Ü–∏—è, –≤–æ–∑–≤—Ä–∞—â–∞–µ–º
                return p;
        }
