        List.Position p, q; // –£–∫–∞–∑–∞—Ç–µ–ª–∏ –¥–ª—è –ø—Ä–æ—Ö–æ–¥–∞ –ø–æ —Å–ø–∏—Å–∫—É
        p = list.First();
        while (!(p.equals(list.End()))) { // –ü—Ä–æ—Ö–æ–¥ –ø–µ—Ä–≤—ã–º —É–∫–∞–∑–∞—Ç–µ–ª–µ–º –ø–æ –º–∞—Å—Å–∏–≤—É
            q = list.Next(p);
            while (!(q.equals(list.End()))) { // –ü—Ä–æ—Ö–æ–¥ –≤—Ç–æ—Ä—ã–º —É–∫–∞–∑–∞—Ç–µ–ª–µ–º –ø–æ –º–∞—Å—Å–∏–≤—É
                if (list.Retrieve(p).equals(list.Retrieve(q))) // –ü—Ä–æ–≤–µ—Ä—è–µ–º —Ä–∞–≤–Ω—ã –ª–∏ —ç–ª–µ–º–µ–Ω—Ç—ã, –µ—Å–ª–∏ –¥–∞, —É–¥–∞–ª—è–µ–º
                    list.Delete(q);
                else // –ò–Ω–∞—á–µ –ø–µ—Ä–µ—Ö–æ–¥–∏ –∫ —Å–ª–µ–¥—É—é—â–µ–º—É —ç–ª–µ–º–µ–Ω—Ç—É
                    q = list.Next(q);
            }
            p = list.Next(p); // –ò—â–µ–º –¥—É–±–ª–∏–∫–∞—Ç—ã —Å–ª–µ–¥—É—é—â–µ–≥–æ —ç–ª–µ–º–µ–Ω—Ç–∞
        }
    }
}

